import React from "react";
import { useSelector } from "react-redux";
import newsItem from "./components/newsItem/newsItem";

import "./App.css";

const newssList = () => {
  const { newsList } = useSelector(
    (state) => state.newsSlice
  );

  return (
    <div className="newsList_items">
      {
        newsList.map((elem) => <newsItem key={elem.id} news={elem} />)
      }
    </div>
  );
};

export default newssList;
